import React, { useState } from "react";
import "/Users/alokwaigaonkar/health_care/src/css/navbar.css";
import Logo from "../images/logo.png";
import Data from "../data"; // Importing the patient data
import PatientCard from "./PatientCard";

export default function Navbar() {
  const [text, setText] = useState("");
  const [error, setError] = useState("Patient Name");
  const [searchResults, setSearchResults] = useState([]); // Store search results

  // Handle input change
  const handleInputChange = (event) => {
    setText(event.target.value);
  };

  // Search function to filter Data
  const searchFunction = (name) => {
    if (name.trim() === "") {
      setError("Patient Name");
      setSearchResults([]);
      return;
    }

    const filteredResults = Data.filter((patient) =>
      patient.name.toLowerCase().includes(name.toLowerCase()) // Case-insensitive search
    );

    if (filteredResults.length > 0) {
      setSearchResults(filteredResults);
    } else {
      setError("No Patient Found!");
      setSearchResults([]);
    }
  };

  // Handle form submission
  const handleOnSubmit = (event) => {
    event.preventDefault();
    searchFunction(text);
  };

  return (
    <div>
      <nav className="navbar">
        <a className="navbar-brand" href="">
          <img src={Logo} alt="Logo" style={{ width: "80px" }} />
        </a>

        <form role="search" onSubmit={handleOnSubmit}>
          <input
            className="input-section"
            type="search"
            placeholder={error}
            aria-label="Search"
            value={text}
            onChange={handleInputChange}
          />
          <button type="submit" className="btn nav-btn btn-outline-success m-4">
            Submit
          </button>
        </form>
      </nav>

      {/* Display search results */}
      <div className="search-results">
        {searchResults.length > 0 ? (
          searchResults.map((patient) => (
            <PatientCard/>
          ))
        ) : null}
      </div>
    </div>
  );
}
